import React from "react";
import Form from "../components/questions/Form";
import { Button } from "@mui/joy";
import { Logo } from "../components/Logo";
export function Home({ quizStatus, setQuizStatus }) {
  return (
    <div>
      <div className="p-[4rem pt-[18rem] h-screen w-full flex flex-col justify-center items-center">
        <Logo/>
        {quizStatus ? (
          <div>Finished</div>
        ) : (
          <Form setQuizStatus={setQuizStatus} />
        )}
        <Button
          variant="soft"
          color="primary"
          bgColor="primary"
          onClick={() => {
            window.location.assign("/menu");
          }}
        >
          View Menu
        </Button>
      </div>

      <div
        id="footer"
        className="h-[6rem] bg-primary w-full absolute bottom-0 flex justify-center items-center"
      >
        <div className="text">HackNJIT 2023 - Team Phi Sig</div>
      </div>
    </div>
  );
}
